.title{
    color:#ffffff;
    text-align: center;
    padding-top: 5.5rem;
}

.heading{
    font-size: 5.6rem;
    line-height: 1.07143;
    letter-spacing: -.005rem;
}
.subheading{
    font-size: 2.65rem;
    margin-top: .6rem;
    letter-spacing: .008rem;
    font-weight: 400;
}

.cta{
    text-align: center;
    margin-top: 1.8rem;
}
.cta-link{
    color: #66bbff;
    font-size: 2.1rem;
    display: inline-block;
}
.cta-link:nth-child(2){
    margin-left: 2.6rem;
}



// ----------------------cards section-------------------------------------
    // -----------------------top-------------------------------------
.top-sec{
    display: flex;
    justify-content: space-around;
}
