// ----------------------------foooter------------------------------------
.footer-col {
    flex-basis: 25%;
}

.footer-col h4 {
    margin-bottom: 10px;
    font-weight: bold;
}

.footer-col ul {
    list-style: none;
    padding: 0;
}

.footer-col li {
    margin-bottom: 6px;
}

.footer-col a {
    color: #333;
    text-decoration: none;
}

.footer-col a:hover {
    color: #000;
}


.footer-header{
    font-size:13px;
}
.column-footer{
    display: flex;
    justify-content: space-between;
}
// -----------phone footer --------------------------------
.accordion{
    display: none;
}

@media screen and (max-width: 768px){
    .accordion{
        display: block;
    }
    .container-footer{
        display: none;
    }
}
